# Function to load data from JSON file
def load_sample_data(filename='sample_data.json'):
    with open(filename, 'r') as f:
        json_data = json.load(f)
    return json_data  # Return the loaded JSON data

# Function to split data into issues and solutions
def get_issues_and_solutions():
    # Combine hardcoded data and loaded data
    combined_data = data + load_sample_data()  # Merge hardcoded and JSON data
    issues = [item['issue'] for item in combined_data]
    solutions = [item['solution'] for item in combined_data]
    return issues, solutions